import React from 'react';
import pokemonList from './pokemon'; // ./ means check the current directory for this file
import './App.css';

function Pokemon() { // this is a component
  let caughtText = "Not caught";
  if (pokemon.caught) {
    caughtText = "Caught";
  }

  return <div>{pokemon.name}, {pokemon.type}, {caughtText}</div>
}

function App() {
  return (
    <div>
      <h1>Pokedex</h1>
      <Pokemon />
      {pokemonList.map(pokemon => {
        return <Pokemon />
      })}
    </div>
  );
}

export default App;
